import { Link } from 'react-router-dom';

const Error = () => {
    return(
        <div backgroundColor="blue">
            <h1 color='ff0000'>Error 404</h1>
            <h2 color='d3d3d3'>Page not found</h2>
            <p/>
            <button>
                <Link to='/home'>Back to Home</Link>
            </button>
        </div>
    )
}

export default Error;
